import React from "react";
import { Text } from "../components/atomes";

function Home() {
  return (
    <div>
      <h1>Home</h1>
      <Text.h1>Test</Text.h1>
      <Text.hint>hint</Text.hint>
      <Text.sm>sm text</Text.sm>
      <Text.error>error</Text.error>
      <Text.h3></Text.h3>
    </div>
  );
}

export default Home;
